import React from 'react';
import Container from '@material-ui/core/Container';
import { makeStyles } from '@material-ui/core/styles';
import Link from '@material-ui/core/Link';

const useStyle = makeStyles(theme => ({
    container:{
        height: '90vh',
        overflow: 'scroll',
        flexDirection:'column',
        maxWidth: '700px',
    },
    itemContainer:{
        display: 'flex',
        flexDirection:'row',
        height: '27vh',
        [theme.breakpoints.down('md')]:{
            height:'18vh'
        },
        width:'100%',
        backgroundColor:'#f4f4f4',
        marginTop: '1vh',
        marginBottom:'1vh'
    },
    profile:{
        display:'flex',
        width: '35%',
        height: '100%',
        backgroundColor:'#cccccc',
    },
    info:{
        display:'flex',
        flexDirection:'column',
        width:'65%',
        height:'100%',
        fontSize: '3vh',
        [theme.breakpoints.down('md')]:{
            fontSize: '2vh',
        }
    },
    title:{
        display: 'flex',
        padding: '5%'
    },
    rating:{
        display: 'flex',
        flexDirection:'row',
        width: '100%',
        height: '30%',
        fontSize: '1vh'
    },
    stars:{
        display: 'flex',
        width: '85px',
        height: '14px',
        [theme.breakpoints.up('md')]:{
            width: '120px',
            height: '20px',
        },
        background: "url(" + require('../../static/rating/small_4.png') + ")",
        backgroundSize: 'cover',
        marginLeft: '5%'
    },
    reviews:{
        display: 'flex'
    }

}))

const ResultList = () => {
    const classes = useStyle();
    return (
        <Container className={classes.container}>
            {[0, 1, 2, 3, 4, 5].map(value => (
                <div id={value} className={classes.itemContainer}>
                    <div className={classes.profile}></div>
                    <div className={classes.info}>
                        <Link href={`/detail/:${value}`} className={classes.title}>Hello</Link>
                        <div className={classes.rating}>
                            <div className={classes.stars}></div>
                            <p> reviews 11920 </p>
                        </div>
                    </div>
                </div>))
            }
        </Container>
    )
}

export default ResultList;
